import React from 'react'
// import "../../Components//Divorce/Divorce.css";
import Navbar from '../../Components/Navbar/Navbar'
import Footer from '../../Components/Footer/Footer'
// import Divorce from '../../Components/Divorce/Divorce.js'
// import Civil from '../../Components/Civil/Civil'
// import Internacional from '../../Components/Internacional/Internacional'
// import Mercantil from '../../Components/Mercantil/Mercantil'
import AddressAndTime from '../../Components/AddressAndTime/AddressAndTime'

import Contacto from '../../Components/Contacto/Contacto'

function ContactoPage() {
  return (
    <>
        <Navbar/>
            <Contacto
            cName='penal'
            cImg={require('../../img/connectus2.jpeg')}
            title='联系我们'
            text='

            如何找到我们: 
             '

            />

                <p className='maps'>
                <iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d1585.2420698261997!2d-6.001896619545538!3d37.37838135708281!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0xd126c3e424e75a1%3A0x3ce9eaef5f823c9f!2sGaro%C3%B1a%20%26%20Asociados!5e0!3m2!1sen!2ses!4v1679259444998!5m2!1sen!2ses" width="400" height="300" style="border:0;" allowfullscreen="" loading="lazy" referrerpolicy="no-referrer-when-downgrade"></iframe>
                </p>

            <AddressAndTime className='address'/>
            <Footer/>

    </>

  )
} 

export default ContactoPage;
